test("Response status code is 200", function () {
    expect(res.getStatus()).to.equal(200);
});


test("Response has the required fields - changeCounts and changes", function () {
    const responseData = res.getBody();

    expect(responseData).to.be.an('object');
    expect(responseData).to.have.property('changeCounts');
    expect(responseData).to.have.property('changes');
});


test("Changes array should have the correct structure", function () {
    const responseData = res.getBody();

    expect(responseData.changes).to.be.an('array');
    responseData.changes.forEach(function(change) {
        expect(change).to.have.property('item').that.is.an('object');
        expect(change).to.have.property('changeType').that.is.a('string');
    });
});


test("ChangeType in changes array is a non-empty string", function () {
    const responseData = res.getBody();

    expect(responseData.changes).to.be.an('array').that.is.not.empty;
    responseData.changes.forEach(function(change) {
        expect(change.changeType).to.be.a('string').and.to.have.lengthOf.at.least(1, "ChangeType should be a non-empty string");
    });
});

test("Response status code is 200", function () {
    expect(res.getStatus()).to.equal(200);
});


test("Content-Type is application/json", function () {
    expect(res.getHeader("Content-Type")).to.include("application/json");
});


test("Author object should have name, email, date, and imageUrl properties", function () {
    const responseData = res.getBody();
    
    expect(responseData.author).to.be.an('object');
    expect(responseData.author.name).to.be.a('string');
    expect(responseData.author.email).to.be.a('string');
    expect(responseData.author.date).to.exist.and.to.be.a('string');
    expect(responseData.author.imageUrl).to.be.a('string');
});


test("Changes array is present and contains at least one element", function () {
    const responseData = res.getBody();
    
    expect(responseData).to.be.an('object');
    expect(responseData.changes).to.exist.and.to.be.an('array').that.is.not.empty;
});

