test("Response status code is 200", function () {
    expect(res.getStatus()).to.equal(200);
});


test("Value array should not be empty", function () {
    const responseData = res.getBody();
    
    expect(responseData.value).to.be.an('array').and.to.have.lengthOf.at.least(1, "Value array should not be empty");
});


test("Count field is present and has a value of 0", function () {
    const responseData = res.getBody();
    
    expect(responseData).to.have.property('count', 0);
});


test("IsDisabled and IsInMaintenance are boolean values", function () {
    const responseData = res.getBody();
    
    expect(responseData.value).to.be.an('array');
    responseData.value.forEach(function(repository) {
        expect(repository.isDisabled).to.be.a('boolean');
        expect(repository.isInMaintenance).to.be.a('boolean');
    });
});

